import React, { useState, useEffect } from "react";
import { Spin, Typography, Row } from "antd";

const { Title } = Typography;

function Generator({ tracks, tags }) {
  return (
    <div>
      <Row>
        <Typography>
          <Title level={2}>Generating art</Title>
        </Typography>
      </Row>
      <Row>
        <Spin size="large" />
      </Row>
    </div>
  );
}

export default Generator;
